import React from 'react';

const Watching = (number) =>{
    alert('i am Watching number  ')
}

const Navbar = (props) => {
    const number = props.id;
    
    return (
        <>
        <div className = {`container ${props.btao}`}>
            <div className = "images">
                <img src = {props.images}/>
            </div>
            <div className = "sec">
            <div className = "about">
                <h3> {props.title}</h3>
                <p> {props.btao} </p>
                <p> {props.date}</p>
            </div>
            <div className = "buttons">
                <button onClick = {watching}> Watch Now</button>
                <button> Add to Wishlist</button>
            </div>
            </div>
        </div>
        </>
    )
}

export default Navbar;
export {Watching};
